func HasRouter() predicate.ServiceTemplate {
	return predicate.ServiceTemplate(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, RouterTable, RouterColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.Router
		step.Edge.Schema = schemaConfig.ServiceTemplate
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasRouterWith applies the HasEdge predicate on the "router" edge with a given conditions (other predicates).
func HasRouterWith(preds ...predicate.Router) predicate.ServiceTemplate {
	return predicate.ServiceTemplate(func(s *sql.Selector) {
		step := newRouterStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.Router
		step.Edge.Schema = schemaConfig.ServiceTemplate
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ServiceTemplate) predicate.ServiceTemplate {
	return predicate.ServiceTemplate(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ServiceTemplate) predicate.ServiceTemplate {
	return predicate.ServiceTemplate(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ServiceTemplate) predicate.ServiceTemplate {
	return predicate.ServiceTemplate(sql.NotPredicates(p))
}
